export const getCartData = async () => {
  let data = []
  try {
     data = await fetch("http://localhost:8085/food", {
      headers: {
        'Cache-Control': 'no-cache',
        'Pragma': 'no-cache',
        'Content-Type': 'application/json'
      },
    })
  }
  catch (error) {
    console.error(error)
  }
  return data
}
